import React, { useState, useContext, useEffect } from 'react';
import { Container, Form, Button, Card, Alert } from 'react-bootstrap';
import { useNavigate, useLocation } from 'react-router-dom';
import axios from 'axios';
import { AuthContext } from '../../context/AuthContext';

const PurchaseForm = () => {
  const { user, token } = useContext(AuthContext);
  const navigate = useNavigate();
  const location = useLocation();
  
  // Verificar si se recibió un producto desde otra página
  const selectedProduct = location.state?.product;
  
  const [formData, setFormData] = useState({
    product: selectedProduct?.name || '',
    amount: selectedProduct?.price || ''
  });
  
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const { product, amount } = formData;

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  useEffect(() => {
    // Redirigir si no hay usuario autenticado
    if (!user) {
      navigate('/login');
    }
  }, [user, navigate]);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');

    // Validaciones básicas
    if (!product.trim() || !amount) {
      return setError('El nombre del producto y el monto son obligatorios');
    }

    if (isNaN(amount) || parseFloat(amount) <= 0) {
      return setError('El monto debe ser un número mayor que 0');
    }

    try {
      setLoading(true);
      
      // Configurar el encabezado de autorización
      const config = {
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${token}`
        }
      };
      
      const purchaseData = {
        product: product.trim(),
        amount: parseFloat(amount)
      };
      
      const response = await axios.post('/api/purchases', purchaseData, config);
      
      setSuccess('¡Compra realizada exitosamente!');
      setFormData({
        product: '',
        amount: ''
      });
      
      // Redirigir después de 2 segundos
      setTimeout(() => {
        navigate('/my-purchases');
      }, 2000);
    } catch (err) {
      console.error('Error al realizar la compra:', err);
      setError(
        err.response?.data?.error || 
        'Error al procesar la compra. Verifica tu conexión e inténtalo nuevamente.'
      );
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container className="my-5">
      <Card className="shadow-sm">
        <Card.Header as="h2" className="text-center bg-success text-white">
          Realizar Compra
        </Card.Header>
        <Card.Body>
          <Form onSubmit={handleSubmit}>
            {error && <Alert variant="danger">{error}</Alert>}
            {success && <Alert variant="success">{success}</Alert>}
            
            <Form.Group className="mb-3" controlId="product">
              <Form.Label>Nombre del Producto*</Form.Label>
              <Form.Control
                type="text"
                name="product"
                value={product}
                onChange={handleChange}
                placeholder="Ingresa el nombre del producto"
                required
              />
            </Form.Group>
            
            <Form.Group className="mb-3" controlId="amount">
              <Form.Label>Monto*</Form.Label>
              <Form.Control
                type="number"
                name="amount"
                value={amount}
                onChange={handleChange}
                placeholder="Ingresa el monto de la compra"
                min="0.01"
                step="0.01"
                required
              />
            </Form.Group>
            
            <div className="d-grid gap-2">
              <Button 
                variant="success" 
                type="submit"
                disabled={loading || success}
              >
                {loading ? 'Procesando...' : 'Realizar Compra'}
              </Button>
              <Button 
                variant="outline-secondary" 
                onClick={() => navigate('/products')}
                disabled={loading || success}
              >
                Cancelar
              </Button>
            </div>
          </Form>
        </Card.Body>
      </Card>
    </Container>
  );
};

export default PurchaseForm;
